import React from 'react';

const Profile = () => {
  return (
    <div>
      <h2>User Profile</h2>
      {/* Display user profile information */}
      <p>Name: John Doe</p>
      <p>Email: john@example.com</p>
      {/* Add other profile details */}
    </div>
  );
};

export default Profile;
